import React, { useState, useEffect } from 'react';
import '@fortawesome/fontawesome-free/css/all.min.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';

export default function ViewTournament(){
    const [tournaments, setTournaments] = useState([]);

    const handleViewTournament = async (event) => {
        event.preventDefault();

    useEffect( () =>{
        const fetchTournaments = async () =>{
            try{
                const response = await axios.get('http://localhost:808/tournaments');
                    setTournaments(response.data);
                }
                catch(error){
                    alert("SUMTING WONG");
                }
            };

            fetchTournaments();
        }, []);
    };

    return (
        <div>
          <h1>List of Tournaments</h1>
          <ul>
            {tournaments.map(tournament => (
              <li key={tournament.getId()}>{tournament.getName()}</li>
            ))}
          </ul>
        </div>
      );
};
